import React, { useEffect } from "react";
import PanelTemplate from "./PanelTemplate";
import { useNavigate } from "react-router-dom";


function EmployeeList() {
    const navigate = useNavigate();
    const git = (page) => {
        navigate(`/manager${page}`)
    }
    const [employees, setEmployees] = React.useState([]);

    useEffect(() => {
        fetch("http://localhost:5003/manager/employeeList")
            .then(res => res.json())
            .then(data => {
                if (data.success) {
                    setEmployees(data.employees);
                } else {
                    console.error("Liste alınamadı:", data.message);
                }
            })
            .catch(err => console.error("İstek hatası:", err));
    }, []);
    return (
        <PanelTemplate
            title="Employee List"
            rightContent={
                <div>
                    <h2>Employee List</h2>
                    <table border="1" style={{ width: "100%", marginTop: "20px", textAlign: "center" }}>
                        <thead>
                            <th>Person ID</th>
                            <th>First Name</th>
                            <th>Last Name</th>
                            <th>Gender</th>
                            <th>Email</th>
                            <th>Address</th>
                            <th>City</th>
                            <th>Postal Code</th>
                            <th>Phone Number</th>
                            <th>Age</th>
                            <th>Username</th>
                            <th>Hire Date</th>
                            <th>Salary</th>
                            <th>Service Duration</th>
                        </thead>

                        <tbody>
                            {employees.map((employee) => (
                                <tr key={employee.person_id}>
                                    <td>{emp.person_id}</td>
                                    <td>{emp.first_name}</td>
                                    <td>{emp.last_name}</td>
                                    <td>{emp.gender}</td>
                                    <td>{emp.email}</td>
                                    <td>{emp.address}</td>
                                    <td>{emp.city}</td>
                                    <td>{emp.postal_code}</td>
                                    <td>{emp.phone_number}</td>
                                    <td>{emp.age}</td>
                                    <td>{emp.username}</td>
                                    <td>{emp.hire_date}</td>
                                    <td>{emp.salary}</td>
                                    <td>{emp.service_duration}</td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                </div>

            }
        />
    );
}

export default EmployeeList;
